import React, { useState } from "react";
import { BrowserRouter as Router, Routes, Route, useNavigate } from "react-router-dom";
import Login from "./components/Frontend/loginPage";
import AdminDashboard from "./components/Frontend/adminDashboard";
import EmployeeDashboard from "./components/Frontend/employeeDashboard";
import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
  const [user, setUser] = useState(null);

  const handleLogin = (username) => {
    if (username === "admin" || username === "hr") {
      setUser(username);
      window.location.href = "/admin";
    } else if (username === "employee") {
      setUser(username);
      window.location.href = "/employee";
    } else {
      alert("Invalid user for demo. Try admin, hr, or employee.");
    }
  };

  return (
    <Router>
      <Routes>
        <Route path="/" element={<Login onLogin={handleLogin} />} />
        <Route path="/admin" element={<AdminDashboard />} />
        <Route path="/employee" element={<EmployeeDashboard />} />
      </Routes>
    </Router>
  );
}

export default App;
